import Navbar from './Navbar'
import Head from 'next/head'

const Layout = (props) =>(
    <div>
        <head>
            <title>My App</title>
        </head>
        <Navbar />
        <hr />
        <hr />
        {props.children}
        <style jsx>{`
        div {
            margin: auto;
            width: 50%;
            border: 3px solid green;
            padding: 10px;
            text-align: center;
          }
      `}</style>
    </div>
);

export default Layout;
